import React from "react";
import "./App.css";

function Comments( {logEntries, athletes} ) {

    console.log(logEntries[0])
    console.log(athletes[logEntries[0].athlete_id - 1].name)

    function dateFormat(date) { 
        date.created_at.slice(5, 10)
    }

    const displayLog = logEntries.map((entry) => {
        console.log(athletes[entry.athlete_id - 1].name)

        return (
            <>
                <h5>{athletes[entry.athlete_id - 1].name}</h5>
                <p>{entry.created_at.slice(5, 10)}</p>
            </>
        )
    }) 

return (
    <div>
        {displayLog}
    </div>
  )
}
export default Comments
